import React, { Component } from 'react'
import styled from 'styled-components'

// Components
import FullScreen from '../fullscreen'

// Images
import background from './background.jpg'

const ProfileWrapper = styled(FullScreen)`
  background: linear-gradient(rgba(0, 0, 0, 0.7), rgba(0, 0, 0, 0.7)),
    url(${background});
  background-size: cover;
  color: white;
  width: 70%;
  display: inline-block;
  vertical-align: top;
`

const ProfileName = styled.h1`
  font-family: 'Julius Sans One', sans-serif;
  font-size: 5.5rem;
  margin: 0 0 10px;
`

const ProfileDetail = styled.p`
  font-size: 0.9rem;
  letter-spacing: 3px;
  margin: 0;
  opacity: 0.6;
  margin-left: 10px;
`

const ExperinceWrapper = styled(FullScreen)`
  width: 30%;
  display: inline-block;
  vertical-align: top;
`

class Profile extends Component {
  render() {
    return (
      <React.Fragment>
        <ProfileWrapper>
          <ProfileName>PUNN</ProfileName>
          <ProfileDetail>Punchaya Siriphanthong | Pun</ProfileDetail>
          <ProfileDetail>26 December 1996 | 22 years old</ProfileDetail>
          <ProfileDetail>p.siriphanthong@gmail.com</ProfileDetail>
          {/* <p>การบ้าน</p>
          <p>
            Welcome, my name is Punchaya Siriphanthong. <br />
            My girlfriend is Pattarawadee Tamthinthai. I love her so much. :)
          </p> */}
        </ProfileWrapper>
        <ExperinceWrapper>
          <p>Assumption Collect Ubonratchathani</p>
          <p>King's Mongkut University</p>
        </ExperinceWrapper>
      </React.Fragment>
    )
  }
}

export default Profile
